import React, {Component} from 'react';

class Machine extends Component {

  componentDidMount() {
    if (this.props.type === 'Stone ') {
      this.props.mining(this.props.tierAmount);
    }
  };

  render() {
    return (
      <div className="machine">
        <p>Machine T{this.props.tier}</p>
      </div>
    )
  }
}
 export default Machine;
